import React from "react";
import Grid from "./Grid";
import './style.css';
import UniqloPage from "./UniqloPage";
import {
  Switch,
  Route,
  Link
} from "react-router-dom";

function Home() {
  return (
      <div className="App-header">
        <h1 className="name">Joya Jeong</h1>
        <div className="intro">
          I'm a UNSW Information Systems/Commerce student that is an aspiring product
          and UI designer. Check out some of my work below!
        </div>
        <div className="grid-container">
            <div className="container">
              <div className="grid-item">
                <Link to='/uniqlo'>
                  <img className="resize" src={uniqlo} alt="uniqlo" />
                  <div className="overlay">
                    <div className="text">UI Design: UNIQLO App Redesign</div>
                  </div>
                </Link>
              </div>
            </div>
            <div className="container">
              <div className="grid-item">
                <img className="resize" src={nutri} alt="nutri" />
                <div className="overlay">
                  <div className="text">UI Design: Nutri Prototype</div>
                </div>
              </div>
            </div>
        </div>
        <Link to='/contact'>to contact</Link>
      </div>
  );
}

export default Home;
